import React from "react";

const Footer = () => {
  return (
    <footer className="bg-dark text-white text-center p-3 mt-5">
      <div className="container">
        <p className="m-0">© 2023 BiblioAvis - Tous droits réservés</p>
      </div>
    </footer>
  );
};

export default Footer;
